- backend_name: Kokoro
  version_configs:
    latest:
      image_name: ghcr.io/remsky/kokoro-fastapi-gpu:latest
      custom_framework: cuda
  default_run_command: python -m uvicorn api.src.main:app --host 0.0.0.0 --port {{port}}
    --log-level debug
  is_built_in: false
  framework_index_map:
    cuda:
    - latest
  icon: data:image/png;base64,
- backend_name: llama.cpp
  description: 'llama.cpp (https://github.com/ggml-org/llama.cpp) is a lightweight,
    high-performance inference engine for running large language models locally.

    It focuses on efficient CPU and edge deployment with minimal dependencies, supporting
    quantization and broad hardware compatibility.

    It enables fast, low-cost LLM inference without requiring GPUs or complex infrastructure.

    Only models in the GGUF format are supported.

    '
  version_configs:
    cuda:
      image_name: ghcr.io/ggml-org/llama.cpp:server-cuda
      custom_framework: cuda
    cpu:
      image_name: ghcr.io/ggml-org/llama.cpp:server
      custom_framework: cpu
    vulkan:
      image_name: ghcr.io/ggml-org/llama.cpp:server-vulkan
      custom_framework: rocm
    musa:
      image_name: ghcr.io/ggml-org/llama.cpp:server-musa
      custom_framework: musa
    rocm:
      image_name: ghcr.io/ggml-org/llama.cpp:server-rocm
      custom_framework: rocm
  default_version: cpu
  default_run_command: -m {{model_path}} --host 0.0.0.0 --port {{port}} --alias {{model_name}}
  is_built_in: false
  health_check_path: /v1/models
  framework_index_map:
    cuda:
    - cuda
    cpu:
    - cpu
    rocm:
    - rocm
    - vulkan
    musa:
    - musa
  icon: data:image/png;base64,
- backend_name: MinerU
  default_run_command: mineru-vllm-server --port {{port}} --served-model-name {{model_name}}
  version_configs:
    v2.7.0:
      image_name: gpustackcommunity/mineru:v2.7.0
      custom_framework: cuda
  default_version: v2.7.0
  icon: data:image/png;base64,
- backend_name: PaddleX-GenAI
  version_configs:
    latest:
      image_name: ccr-2vdh3abv-pub.cnc.bj.baidubce.com/paddlepaddle/paddlex-genai-vllm-server:latest
      custom_framework: cuda
    latest-dcu:
      image_name: ccr-2vdh3abv-pub.cnc.bj.baidubce.com/paddlepaddle/paddleocr-genai-vllm-server:latest-dcu
      custom_framework: dtk
    latest-metax-gpu:
      image_name: ccr-2vdh3abv-pub.cnc.bj.baidubce.com/paddlepaddle/paddleocr-genai-fastdeploy-server:latest-metax-gpu
      run_command: paddlex_genai_server --model_name {{model_name}} --model_dir {{model_path}}
        --host 0.0.0.0 --port {{port}} --backend fastdeploy
      custom_framework: maca
  default_version: latest
  default_run_command: paddlex_genai_server --model_name {{model_name}} --model_dir
    {{model_path}} --host 0.0.0.0 --port {{port}} --backend vllm
  is_built_in: false
  framework_index_map:
    cuda:
    - latest
    dtk:
    - latest-dcu
    maca:
    - latest-metax-gpu
  icon: data:image/png;base64,
- backend_name: Text-Embeddings-Inference
  description: 'TEI (Text Embeddings Inference) is a high-performance engine by Hugging
    Face specifically optimized for deploying embedding and reranking models on CUDA
    or CPU.

    It is the definitive choice for RAG production environments, offering ultra-low
    latency and superior throughput compared to general LLM frameworks like vLLM or
    llama.cpp.

    '
  version_configs:
    cpu-1.8:
      image_name: ghcr.io/huggingface/text-embeddings-inference:cpu-1.8
      custom_framework: cpu
    cuda-sm89-1.8:
      image_name: ghcr.io/huggingface/text-embeddings-inference:89-1.8
      custom_framework: cuda
    cuda-sm86-1.8:
      image_name: ghcr.io/huggingface/text-embeddings-inference:86-1.8
      custom_framework: cuda
    cuda-sm80-1.8:
      image_name: ghcr.io/huggingface/text-embeddings-inference:1.8
      custom_framework: cuda
  default_version: cpu-1.8
  default_run_command: --model-id {{model_path}} --port {{port}}
  is_built_in: false
  health_check_path: /health
  framework_index_map:
    cpu:
    - cpu-1.8
    cuda:
    - cuda-sm80-1.8
    - cuda-sm86-1.8
    - cuda-sm89-1.8
  icon: data:image/png;base64,
